import React from 'react'
import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card';

export function NoviceDetails ({ nproduct }) {
    console.log(nproduct)
    return (
        <Card style={{ width: '18rem' }}>
            <Card.Img variant="top" src="https://images.unsplash.com/photo-1663738017510-00aaa40ba441?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHx0b3BpYy1mZWVkfDI0fEJKSk10dGVESkE0fHxlbnwwfHx8fA%3D%3D&auto=format&fit=crop&w=600&q=60" />
            <Card.Body>
                <Card.Title>{nproduct.title}</Card.Title>
                <Card.Text>
                    {nproduct.description}
                </Card.Text>
                <Button variant="primary">Buy Now</Button>
            </Card.Body>
        </Card>

    )
}
